            "text": "<!DOCTYPE html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title>异步加载数据,分页</title>\r\n<!-- 此文件为了显示Demo样式，项目中不需要引入 -->\r\n<link href=\"../../assets/code/demo.css\" rel=\"stylesheet\">\r\n\r\n  <link href=\"http://g.alicdn.com/bui/bui/1.1.21/css/bs3/dpl.css\" rel=\"stylesheet\">\r\n  <link href=\"http://g.alicdn.com/bui/bui/1.1.21/css/bs3/bui.css\" rel=\"stylesheet\">\r\n\r\n</head>\r\n<body>\r\n  <script src=\"http://w.cnzz.com/q_stat.php?id=1253711425\"></script> \r\n<div class=\"demo-content\">\r\n    <div class=\"row\">\r\n      <div class=\"span16\">\r\n        <div id=\"grid\">\r\n          \r\n        </div>\r\n      </div>\r\n    </div>\r\n    \n\n  <script src=\"http://g.tbcdn.cn/fi/bui/jquery-1.8.1.min.js\"></script>\n  <script src=\"http://g.alicdn.com/bui/seajs/2.3.0/sea.js\"></script>\n  <script src=\"http://g.alicdn.com/bui/bui/1.1.21/config.js\"></script>\n\n<!-- script start --> \n    <script type=\"text/javascript\">\r\n        BUI.use(['bui/grid','bui/data'],function(Grid,Data){\r\n            var Grid = Grid,\r\n          Store = Data.Store,\r\n          columns = [\r\n            {title : '表头1',dataIndex :'a', width:100},\r\n            {id: '123',title : '表头2',dataIndex :'b', width:100},\r\n            {title : '表头3',dataIndex : 'c',width:200}\r\n          ];\r\n\r\n        /**\r\n         * 自动发送的数据格式：\r\n         *  1. start: 开始记录的起始数，如第 20 条,从0开始\r\n         *  2. limit : 单页多少条记录\r\n         *  3. pageIndex : 第几页，同start参数重复，可以选择其中一个使用\r\n         *\r\n         * 返回的数据格式：\r\n         *  {\r\n         *     \"rows\" : [{},{}], //数据集合\r\n         *     \"results\" : 100, //记录总数\r\n         *     \"hasError\" : false, //是否存在错误\r\n         *     \"error\" : \"\" // 仅在 hasError : true 时使用\r\n         *   }\r\n         * \r\n         */\r\n        var store = new Store({\r\n            url : 'data/grid-data.php',\r\n            autoLoad:true, //自动加载数据\r\n            params : { //配置初始请求的参数\r\n              a : 'a1',\r\n              b : 'b1'\r\n            },\r\n            pageSize:3\t// 配置分页数目\r\n          }),\r\n          grid = new Grid.Grid({\r\n            render:'#grid',\r\n            columns : columns,\r\n            loadMask: true, //加载数据时显示屏蔽层\r\n            store: store,\r\n            // 底部工具栏\r\n            bbar:{\r\n                // pagingBar:表明包含分页栏\r\n                pagingBar:true\r\n            }\r\n          });\r\n\r\n        grid.render();\r\n      });\r\n    </script>\r\n<!-- script end -->\r\n  </div>\r\n</body>\r\n</html>\r\n"
